import React from 'react'
import { Link } from 'react-router-dom';

function Header() {
    return (
        <div>
            <div>
                <img src="https://www.libertybooks.com/image/catalog/logo/300x300-02c.png" />
            </div>
            <Link to="/">Home</Link>
            <Link to="about" > Product </Link>
        </div>
    )
}

export default Header
